import React from "react";
import Table_column_child from "./Table_column_child";

function Table_flesh(props){
    console.log("Table_flesh")

    return(
    <div  className={`${props.classN}`} >
        <Table_column_child 
            p_yakliki={props.p_yakliki} 
            s_yakliki={props.s_yakliki} 
            calcule={props.calcule} 
            num={props.num} 
            boy_p={props.boy_p} 
            boy_s={props.boy_s} 
            table_column_children={props.table_column_children} 
        />     
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>{props.flesh_num}</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>{props.flesh_num+1}</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>{props.flesh_num+2}</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>{props.flesh_num+3}</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>{props.flesh_num+4}</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>{props.flesh_num+5}</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>{props.flesh_num+6}</div>
    </div>
    )
}

export default React.memo(Table_flesh) ;
